import React from 'react';
import Product from './Product';

const ProductList = ({ products }) => {
  return (
    <main>
      <ul>
        {products.map(({ name, category, image }) => (
          <Product name={name} category={category} />
        ))}
      </ul>
    </main>
  );
};

export default ProductList;
